import React from "react";
import Layout from "../layout/Layout";


const Main = props => {
  const classes = useStyles();
  const index = 0;

  return (
  
      <Layout>
        <VoteGridTitle
          item={{
            url: `https://picsum.photos/id/50/200/300.webp`,
            title: `VoteOn`,
            subtitle: `Today votes`
          }}
        />
        <VoteGridList />
      </Layout>

  );
};

export default VoteMain;
